import React from 'react';
import '../styles/global.css';

const MaintenanceTable = ({ data }) => {
    return (
        <div className="table-container">
            <table className="table">
                <thead>
                <tr>
                    <th>Residente</th>
                    <th>Fecha</th>
                    <th>Asunto</th>
                    <th>Descripci√≥n</th>
                    <th>Estado</th>
                    <th>Acciones</th>
                </tr>
                </thead>
                <tbody>
                {data.map((maintenance) => (
                    <tr key={maintenance.id}>
                        <td>{maintenance.residente}</td>
                        <td>{maintenance.fecha}</td>
                        <td>{maintenance.asunto}</td>
                        <td>{maintenance.descripcion}</td>
                        <td>
                                <span
                                    className={`badge ${
                                        maintenance.estado.toLowerCase()
                                    }`}
                                >
                                    {maintenance.estado}
                                </span>
                        </td>
                        <td>
                            <button className="table-btn edit">
                                <i className="fas fa-edit"></i>
                            </button>
                            <button className="table-btn delete">
                                <i className="fas fa-trash"></i>
                            </button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default MaintenanceTable;
